import React, { Component } from 'react';
import '../css/navigation-bar.css'

class Navigation extends Component{
    render() {
        return (
            <div id="navigation-bar" className="navigation-bar">
                <div className="suckerdiv">
                    <ul id="suckertree1">
                        <li><a href="#">首页</a></li>
                        <li><a href="#">全部图书浏览</a></li>
                        <li><a href="#">图书推荐</a></li>
                        <li><a href="#">注册&登录</a>
                            <ul>
                                <li><a href="#" onClick="RegisterShow();">注册</a></li>
                                <li><a href="#" onClick="LoginShow();">登录</a></li>
                            </ul>
                        </li>
                        <li><a href="#">我的购物车</a></li>
                    </ul>
                </div>
            </div>
        )
    }
}

export default Navigation;
